import React, { useState } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TableSortLabel,
  Paper,
  TablePagination,
  Collapse,
  IconButton,
  Box,
  Avatar,
  Typography
} from '@mui/material';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import { getColumns } from './columns';
import { trackUserInteraction } from '../../utils/analytics';
import ExpandedRow from './ExpandedRow';
import { TrendingUp as TrendingUpIcon, TrendingDown as TrendingDownIcon } from '@mui/icons-material';
import { useTheme } from '@mui/material/styles';
import { FixedSizeList as List } from 'react-window';

const Row = ({ pair }) => {
  const [open, setOpen] = useState(false);

  return (
    <>
      <TableRow
        sx={{
          '& > td': {
            bgcolor: 'transparent',
            border: 0,
            p: 1,
            color: 'text.secondary',
          },
          '&:hover': {
            '& > td': {
              bgcolor: 'rgba(255, 255, 255, 0.03)',
            }
          }
        }}
      >
        <TableCell>
          <IconButton
            size="small"
            onClick={() => setOpen(!open)}
            sx={{ color: 'text.secondary', p: 0 }}
          >
            <KeyboardArrowDownIcon />
          </IconButton>
        </TableCell>
        <TableCell>
          <Avatar src={pair.logoURI} sx={{ width: 24, height: 24 }} />
        </TableCell>
      </TableRow>
      <TableRow>
        <TableCell style={{ padding: 0 }} colSpan={20}>
          <Collapse in={open} timeout="auto" unmountOnExit>
            <Box sx={{ p: 3 }}>
              <ExpandedRow pair={pair} />
            </Box>
          </Collapse>
        </TableCell>
      </TableRow>
    </>
  );
};

const VirtualizedRow = ({ index, style, data }) => {
  const pair = data[index];
  const columns = getColumns();
  return (
    <div style={style}>
      <Row pair={pair} columns={columns} />
    </div>
  );
};

const PairsTable = ({
  pairs,
  orderBy,
  order,
  page,
  rowsPerPage,
  handleSort,
  handleChangePage,
  handleChangeRowsPerPage,
  totalCount
}) => {
  const columns = getColumns();

  const MemoizedRow = React.memo(Row);

  return (
    <TableContainer
      sx={{
        bgcolor: '#0A1929', // Dark background
        borderRadius: 2,
        '& .MuiTableCell-root': {
          color: 'text.secondary',
        },
      }}
    >
      <Table size="small">
        <TableHead>
          <TableRow>
            <TableCell sx={{ width: 30 }} /> {/* Expand button column */}
            <TableCell>PAIR ↑</TableCell>
            <TableCell align="right">PRICE $</TableCell>
            <TableCell align="right">TODAY FEES ↗</TableCell>
            <TableCell align="right">TVL</TableCell>
            <TableCell align="right">APR 24H</TableCell>
            <TableCell align="right">5M TX</TableCell>
            <TableCell align="right">1H TX</TableCell>
            <TableCell align="right">6H TX</TableCell>
            <TableCell align="right">24H TX</TableCell>
            <TableCell align="right">5M %</TableCell>
            <TableCell align="right">1H %</TableCell>
            <TableCell align="right">6H %</TableCell>
            <TableCell align="right">24H %</TableCell>
            <TableCell align="right">5M VOL</TableCell>
            <TableCell align="right">1H VOL</TableCell>
            <TableCell align="right">6H VOL</TableCell>
            <TableCell align="right">24H VOL</TableCell>
            <TableCell align="right">JOS</TableCell>
            <TableCell align="right">DEX</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {pairs.map((pair, index) => (
            <Row key={pair.id || index} pair={pair} />
          ))}
        </TableBody>
      </Table>
      <Box
        sx={{
          display: 'flex',
          justifyContent: 'flex-end',
          p: 2,
          gap: 2,
          borderTop: '1px solid rgba(255, 255, 255, 0.1)',
        }}
      >
        <Typography variant="body2" color="text.secondary">
          Rows per page: 10
        </Typography>
        <Typography variant="body2" color="text.secondary">
          1-10 of 68055
        </Typography>
      </Box>
    </TableContainer>
  );
};

export default PairsTable;
